import React from 'react'
import {
  Link
} from "react-router-dom";
function App(){
  return (
    <>

      <div>
        <nav>
          <ul style={{listStyleType:none}}>
            <li>
              <Link to="/home">home</Link>
            </li>
            <li>
              <Link to="/contact">contact</Link>
            </li>
          </ul>
        </nav>
      <h4>This is App.tsx page</h4>
      </div>
</>
  );
}
export default App;
